import React from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";
import ShoppingBasketIcon from "@material-ui/icons/ShoppingBasket";

function Navbar() {
  return (
    <nav className="navbar">
      {/* logo*/}
      <Link to="/">
        <img className="navbar_logo" src="./images/logo.jpg" alt="no img" />
      </Link>

      {/* navlinks */}
      <div className="navbar_nav">
        <Link to="/" className="navbar_links">
          <div className="navbar_option">
            <span className="navbar_option_l1">hello</span>
            <span className="navbar_option_l2">Sign In</span>
          </div>
        </Link>
        <Link to="/orders" className="navbar_links">
          <div className="navbar_option">
            <span className="navbar_option">Returns</span>
          </div>
        </Link>

        <Link to="/checkout" className="navbar_links">
          <div className="navbar_basket">
            <ShoppingBasketIcon />
            <span className="navbar_option_l2 basket_count">0</span>
          </div>
        </Link>
      </div>
    </nav>
  );
}

export default Navbar;
